import React, { useState, useEffect } from "react";

const WikiSearch = () => {
  const [searchValue, setSearchValue] = useState("");
  return (
    <div>
      <div className="ui form">
        <div className="field">
          <label>Enter Search value</label>
          <input
            className="input"
            value={searchValue}
            onChange={(e) => setSearchValue(e.target.value)}
          />
        </div>
      </div>
    </div>
  );
};

export default WikiSearch;
